import React from 'react';
class Hero extends React.Component{
	render(){
		return(
			<div id="hero" className="section section-hero">
				<div className="section-hero--light" data-aos="fade-up">
				<h1>Hi, I'm Mary Collins, UI developer and Digital Designer.</h1></div>
				<div className="section-hero--dark" data-aos="fade-down"></div>
			</div>
			);
	}
}
export default Hero;
